import React from 'react'
import axios from "axios";



export const login_Api  = async(login_info)=>{
        try{
            const url = process.env.REACT_APP_API_BASE_URL+"/authetication" ;
            return await  axios.post(url,login_info);

        }catch(err){
            console.log(err)
        }
    }
